    println!(
        "Parser took: {:?}",
        std::time::Instant::now().duration_since(start)
    );

    let start2 = std::time::Instant::now();

    let bytes = get_vm_bytes(&values.instructions, &values.charset);
    let (decoded, drained_bytes) = decode_vm_bytes(bytes);
    println!(
        "Decoder took: {:?}",
        std::time::Instant::now().duration_since(start2)
    );

    let mut kb = KeyBuilder::new(drained_bytes, decoded, values.get, opcodes);
    let res = kb.generate();
    println!("Result: {:?}", res);
